        const canvas = document.getElementById('canvas');
        const ctx = canvas.getContext('2d');
        
        // Function to parse OBJ file and extract vertices
        function parseOBJ(objString) {
            const vertices = [];
            const lines = objString.split('\n');
            for (const line of lines) {
                const parts = line.trim().split(/\s+/);
                if (parts[0] === 'v') {
                    const x = parseFloat(parts[1]);
                    const y = parseFloat(parts[2]);
                    vertices.push({ x, y });
                }
            }
            return vertices;
        }

        // Function to project 3D vertices onto 2D canvas
        function projectVertices(vertices) {
            const projectedVertices = [];
            const scale = Math.min(canvas.width, canvas.height) / 2; // Scale based on canvas size
            for (const vertex of vertices) {
                // Translate and invert Y-coordinate to fit on canvas
                const x2d = (vertex.x * scale) + (canvas.width / 2);
                const y2d = canvas.height - ((vertex.y * scale) + (canvas.height / 2));
                projectedVertices.push({ x: x2d, y: y2d });
            }
            return projectedVertices;
        }


        // Function to draw vertices on canvas
        function drawVertices(vertices) {
            ctx.clearRect(0, 0, canvas.width, canvas.height);
            ctx.fillStyle = 'black';
            for (const vertex of vertices) {
                ctx.fillRect(vertex.x, vertex.y, 2, 2); // Draw small squares for vertices
